import './index.css';

function TodoSearch({ setSearhedTodo, searhedTodo }) {
   function hanleSearch(e) {
      setSearhedTodo(e.target.value);
   }

   return (
      <input
         type='text'
         placeholder='Ingresa el nombre de un TODO'
         className='TodoSearch'
         onChange={hanleSearch}
         value={searhedTodo}
      />
   );
}

export { TodoSearch };
